import React from 'react';

const AboutMe = () => {
  return (
    <section>
      <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.cyberark.com%2Fresources%2Fblog%2Fsecure-developer-workstations-without-slowing-them-down&psig=AOvVaw03ExBfnxV-LpTC4tAHqN0K&ust=1716746557152000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCPCh9rexqYYDFQAAAAAdAAAAABAE" alt="Developer" />
      <p>Starting out as a web developer and learning how to incorporate many levels of code and design.</p>
    </section>
  );
};

export default AboutMe;
